const useStyles = makeStyles({
    root: {
      flex: 1
    },
  });

const Appbar = () => {
    const classes=useStyles()
    return (

        <AppBar position="static">
            <Toolbar>
            <h1>yeeaallaa</h1>
                <Typography className={classes.root}>
                my header
                </Typography>

                <Home/>
            </Toolbar>
        </AppBar>
    )
}

export default Appbar
